// Secure Read/Write File Operations Tool
// Note: This is a simulation that guides users to proper file operations
// In N8N, actual file operations should use dedicated File nodes

// Define the workspace directory for reference
const WORKSPACE_DIR = 'C:\\Repo\\Tardigrade';

// Blocked file extensions for security
const BLOCKED_EXTENSIONS = ['.exe', '.bat', '.cmd', '.ps1', '.vbs', '.scr', '.com'];

function validateFileExtension(filePath) {
  const fileExt = filePath.split('.').pop().toLowerCase();
  return !BLOCKED_EXTENSIONS.includes('.' + fileExt);
}

function validateContent(content) {
  if (!content || typeof content !== 'string') return true;

  const suspiciousPatterns = [
    /eval\s*\(/,
    /exec\s*\(/,
    /system\s*\(/,
    /shell_exec\s*\(/
  ];

  return !suspiciousPatterns.some(pattern => pattern.test(content));
}

function validatePath(filePath) {
  // Basic path traversal check
  return !filePath.includes('..') && !filePath.includes('\\..\\') && !filePath.includes('/../');
}

// Get operation parameters
const input = $input.first().json;
const operation = input.operation || $fromAI('operation', '', 'string');
const filePath = input.file_path || input.filePath || $fromAI('file_path', '', 'string');
const content = input.content || $fromAI('content', '', 'string');
const dirPath = input.path || input.directory || $fromAI('path', '', 'string');

let result;

// Validate inputs
if (operation && ['read', 'write', 'create', 'delete'].includes(operation) && filePath) {
  if (!validatePath(filePath)) {
    result = {
      success: false,
      error: 'Invalid file path: Path traversal detected',
      filePath: filePath
    };
  } else if (!validateFileExtension(filePath)) {
    result = {
      success: false,
      error: `File extension not allowed for security reasons`,
      filePath: filePath
    };
  } else if (operation === 'write' && !validateContent(content)) {
    result = {
      success: false,
      error: 'Suspicious content detected - operation blocked',
      filePath: filePath
    };
  } else {
    // Validation passed - provide instructions for actual file operations
    result = {
      success: true,
      operation: operation,
      filePath: filePath,
      workspace: WORKSPACE_DIR,
      message: `File operation '${operation}' validated successfully`,
      instructions: {
        read: 'Use N8N Read Binary Files node to read from: ' + WORKSPACE_DIR + '\\' + filePath,
        write: 'Use N8N Write Binary Files node to write to: ' + WORKSPACE_DIR + '\\' + filePath,
        create: 'Use N8N Write Binary Files node to create: ' + WORKSPACE_DIR + '\\' + filePath,
        delete: 'Use N8N Move Binary Data node or filesystem commands to delete: ' + WORKSPACE_DIR + '\\' + filePath
      }[operation],
      content: operation === 'write' ? content : undefined,
      timestamp: new Date().toISOString()
    };
  }
} else if (operation === 'list') {
  result = {
    success: true,
    operation: 'list',
    workspace: WORKSPACE_DIR,
    path: dirPath || '/',
    message: 'Directory listing validated',
    instructions: 'Use filesystem commands or File nodes to list directory: ' + WORKSPACE_DIR + (dirPath ? '\\' + dirPath : ''),
    timestamp: new Date().toISOString()
  };
} else {
  result = {
    success: false,
    error: 'Invalid operation or missing parameters',
    supportedOperations: ['read', 'write', 'create', 'delete', 'list'],
    workspace: WORKSPACE_DIR,
    usage: {
      read: 'Provide: operation=read, file_path=filename',
      write: 'Provide: operation=write, file_path=filename, content=text',
      delete: 'Provide: operation=delete, file_path=filename',
      list: 'Provide: operation=list, path=subdirectory (optional)'
    }
  };
}

