ðŸ“„ File: ${result.filePath || result.path || 'N/A'}

${result.instructions || ''}

${result.content ? 'ðŸ“ Content: ' + result.content.substring(0, 200) + (result.content.length > 200 ? '...' : '') : ''}

â° ${result.timestamp}`;
} else {
  return `âŒ Error: ${result.error}

${result.workspace ? 'ðŸ“ Workspace: ' + result.workspace : ''}
${result.supportedOperations ? '\nðŸ”§ Supported operations: ' + result.supportedOperations.join(', ') : ''}
${result.usage ? '\n\nðŸ“– Usage:\n' + Object.entries(result.usage).map(([op, desc]) => `â€¢ ${op}: ${desc}`).join('\n') : ''}`;
